import React, { Component } from 'react'
import Auditorias from '../auditorias/Auditorias'
import { connect } from 'react-redux'
// CSS class "container" centers content

class Dashboard extends Component {
    render() {
        const { auditorias } = this.props
        console.log("esto es el problema", auditorias)
        return (
            <div className="dashboard container">
                <Auditorias auditorias={auditorias}/>
            </div>
        )
    }
}

const mapStateToProps = (state) => {
    return {
        auditorias: state.auditoria.auditorias
    }
}

export default connect(mapStateToProps)(Dashboard)
